import React from 'react'

const Edit = props => {
    return (
        <div className="workouts-div">
            <form action={`/api/users/${props.user._id}?_method=PUT`} method="POST">
                <input type="text" name="name" value={props.user.name} onChange={props.handleChange} />
                <input type="text" name="username" value={props.user.username} onChange={props.handleChange} />
                <button className="btn btn-primary">Submit</button>
            </form>
        </div>
    )
}

export default Edit
